import React from 'react';

import './Login.css';


const Login = () => {
    return (

        <div className="login-page-base">

            {/*<script src="LoginJS.js"></script>*/}

            <section className="login-section">
                <h1 className="login-title">澳門車輛入境車牌生成</h1>
                <form className="login-form" onSubmit={(e) => e.preventDefault()}>
                    <div className="login-buttons">
                    <input type="text" placeholder="Username" className="login-input"/>
                    <input type="password" placeholder="Password" className="login-input"/>
                        <a href="/generate"><button type="submit" className="login-button">登錄</button></a>
                    </div>
                    <a href="/about"><button type="about" className="about-button" >關於</button></a>
                    <div className="footer">
                        沒有帳號？ <a className="footer-link" href="/register"> 點這裡註冊 </a>
                    </div>
                </form>
            </section>
            {/*<video id="video-background" autoPlay muted loop>*/}
            {/*    <source src="src/assets/1507929101-1-16.mp4" type="video/mp4"/>*/}

            {/*</video>*/}
        </div>

    );
};

export default Login;
